import React from 'react';
import './App.css';
import * as io from 'socket.io-client';
import Table from 'react-bootstrap/Table'
import 'bootstrap/dist/css/bootstrap.min.css';


class App extends React.Component{
  constructor() {
    super();

    this.state = {
      exchange: {}
    };
  }
  componentDidMount() {
    var socket = io('wss://le-18262636.bitzonte.com', {
      path: '/stocks'
      });
    socket.on('UPDATE', (data) => {
      console.log(data);
    });
    //socket.emit('STOCK');
  }

  render () {
    return (
      <div className="App">
        <h1>Acción</h1>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>Indicador</th>
              <th>Valor</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Volumen Total Transado</td>
              <td>Mark</td>
            </tr>
            <tr>
              <td>Alto Histórico</td>
              <td>Jacob</td>
            </tr>
            <tr>
              <td>Bajo Histórico</td>
              <td>Jacob</td>
            </tr>
            <tr>
              <td>Último Precio</td>
              <td>Jacob</td>
            </tr>
            <tr>
              <td>Variación Porcentual</td>
              <td>Jacob</td>
            </tr>
          </tbody>
        </Table>
      </div>
    );
  }
} 

export default App;
